import * as React from 'react';
import Button from '@mui/material/Button';
import Email from '@mui/icons-material/Email';
import LinkedIn from '@mui/icons-material/LinkedIn';
import Stack from '@mui/material/Stack';
import "../styles/InfoButtons.css"

export default function InfoButtons() {
  return (
    <div className="Infobuttons--div">
        <Stack direction="row" spacing={10}>
        <Button variant="contained" startIcon={<Email />} className="Buttons--EmailButton">
            Email
        </Button>
        <Button variant="contained" startIcon={<LinkedIn />}>
            Linkedin
        </Button>
        </Stack>
    </div>
  );
}
